    false,nt"url": null,nt"notes": "This Comprehensive Conservation Plan (CCP)
    was written to guide management on Assabet River NWR for the next 15 years. This
    plan outlines the Refuge vision and purpose and describes how Assabet River NWR
    will contribute to the overall mission of the Refuge System. The plan provides an
    introduction to the Refuge, an overview of the CCP process, a summary of Refuge
    resources, information about the management direction, and Refuge administration.
    Key planning issues include: habitat and wildlife management, control of invasive
    species, hunting, management of public uses, resource protection, and infrastructure.",nt"license_title":
